import { Outlet } from "react-router-dom";
import { Link } from "react-router-dom";
import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

const MyPropertyList = () => {
    const [properties, setProperties] = useState([]);
    const [userID, setUserID] = useState(-1);
    const navigate = useNavigate();

    useEffect(() => {
        
        // get the user id
		fetch("http://127.0.0.1:8000/accounts/info/",{
            method: 'GET',
            headers: {
                'Authorization': 'Bearer ' + localStorage.getItem('token')
            }
        })
        .then((response) => response.json())
        .then((data) => {
            setUserID(data.id);
        }
        ).then(() => {

            // get the properties that belong to the user
            fetch("http://localhost:8000/property/list/?owner=" + userID, {
                method: 'GET',
                headers: {
                    'Authorization': 'Bearer ' + localStorage.getItem('token')
                }
            })
            .then((response) => response.json())
            .then((data) => {
                console.log(data);
                setProperties(data);
            }
            );
        });
    }, [userID]);

    return (
        <div className="my-property-list">
            <h1>My Properties</h1>
            <div className="my-property-list-container">
                {properties.map((property) => (
                    <div className="my-property-list-item">
                        <div className="my-property-list-item-image">
                            <img src={property.main_pic} alt="property image" />
                        </div>
                        <div className="my-property-list-item-info">
                            <h2>{property.property_name}</h2>
                            <p>{property.address}</p>
                            <p>{property.city}, {property.country}</p>
                            <p>{property.num_of_guests} guests</p>
                            <p>{property.num_of_beds} beds</p>
                            <p>{property.property_type}</p>
                        </div>
                        <div className="my-property-list-item-buttons">
                            <Link to={"/property/" + property.id + "/edit"}>Edit</Link>
                            <Link to={"/property/" + property.id + "/delete"}>Delete</Link>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default MyPropertyList;
